        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { font-family: 'Inter', -apple-system, sans-serif; background: #0f0f1a; color: #fff; }
        .header { background: linear-gradient(135deg, #1a1a2e 0%, #16213e 100%); padding: 30px 40px; border-bottom: 1px solid rgba(255,255,255,0.1); }
        .header h1 { font-size: 28px; font-weight: 600; margin-bottom: 8px; }
        .header p { color: #888; font-size: 14px; }
        .stats-bar { display: flex; gap: 40px; padding: 20px 40px; background: rgba(255,255,255,0.02); border-bottom: 1px solid rgba(255,255,255,0.05); flex-wrap: wrap; }
        .stat { text-align: center; }
        .stat-value { font-size: 32px; font-weight: 600; color: #74b9ff; }
        .stat-label { font-size: 12px; color: #666; text-transform: uppercase; letter-spacing: 1px; }
        .year-timeline { display: flex; padding: 15px 40px; gap: 4px; background: rgba(0,0,0,0.3); overflow-x: auto; }
        .year-chip { padding: 8px 16px; border-radius: 20px; font-size: 13px; font-weight: 500; cursor: pointer; transition: all 0.2s; white-space: nowrap; border: 2px solid transparent; }
        .year-chip:hover { transform: scale(1.05); }
        .year-chip.active { border-color: white; }
        .year-chip.no-data { background: #333 !important; color: #666; cursor: default; }
        #map { height: calc(100vh - 220px); min-height: 500px; }
        .footer { padding: 20px 40px; background: #0a0a12; text-align: center; font-size: 12px; color: #555; }
        @media (max-width: 600px) { .header { padding: 20px; } .stats-bar { padding: 15px 20px; gap: 20px; } .stat-value { font-size: 24px; } .year-timeline { padding: 10px 20px; } }
